/*Table structure for table `imagejob` */

DROP TABLE IF EXISTS `imagejob`;

CREATE TABLE `imagejob` (
  `Oid` binary(16) NOT NULL,
  `name` varchar(100) DEFAULT NULL,
  `description` text DEFAULT NULL,
  `created_on` datetime DEFAULT NULL,
  `start_on` datetime DEFAULT NULL,
  `end_on` datetime DEFAULT NULL,
  `user_id` binary(16) DEFAULT NULL,
  `project_id` binary(16) DEFAULT NULL,
  `msession_id` binary(16) DEFAULT NULL,
  `status` int(11) DEFAULT NULL,
  `type` int(11) DEFAULT NULL,
  `settings` longtext DEFAULT NULL,
  `cs` decimal(28,8) DEFAULT NULL,
  `path` varchar(255) DEFAULT NULL,
  `output_dir` varchar(100) DEFAULT NULL,
  `direction` smallint(5) unsigned DEFAULT NULL,
  `image_selection_criteria` text DEFAULT NULL,
  `OptimisticLockField` int(11) DEFAULT NULL,
  `GCRecord` int(11) DEFAULT NULL,
  PRIMARY KEY (`Oid`),
  KEY `iGCRecord_ImageJob` (`GCRecord`),
  KEY `iuser_id_ImageJob` (`user_id`),
  KEY `iproject_id_ImageJob` (`project_id`),
  KEY `imsession_id_ImageJob` (`msession_id`),
  CONSTRAINT `FK_ImageJob_msession_id` FOREIGN KEY (`msession_id`) REFERENCES `msession` (`Oid`),
  CONSTRAINT `FK_ImageJob_project_id` FOREIGN KEY (`project_id`) REFERENCES `project` (`Oid`),
  CONSTRAINT `FK_ImageJob_user_id` FOREIGN KEY (`user_id`) REFERENCES `sys_sec_party` (`Oid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

